widgets.colorWidget:
JS{{

var rec = @{recArm1}
var val = @{clip@{parent.variables.n}State}
var clip = @{clip@{parent.variables.n}}

if (rec > 0 && val === 0) {
  return "red"
} else if (val > 94) {
  return "lightgreen" // brighter than "green"
} else if (val === 60) {
  return "red"
} else if (val >= 10) {
  return "yellow"
} else {
  return "white"
}

}}

widgets.label:
JS{{

var name = @{clip@{parent.variables.n}}

if (name === undefined || name == null) {
