}

}}

widgets.onValue:
var n = getProp("parent", "variables").n

var clip = get("clip"+ n + "State", value);
if (clip >= 60) {
  send("/clip" + n + "trig", 0);
  } else {
  send("/clip" + n + "trig", 1);
}

