widgets.onCreate:
const rows = 8;
const cols = 8;

// Loop through all rows and columns
for (let row = 1; row <= rows; row++) {
  for (let col = 1; col <= cols; col++) {
    const buttonId = `${col}-${row}`;
    set(buttonId, 'osc', 'target', value);
  }
}

